import { Radio } from 'antd'
import React from 'react'

const PaymentMode = ({ data, dispatch, expand, change }) => {
   return expand ?
      <Radio.Group onChange={dispatch} value={data} className='flex flex-col gap-6'>
         <Radio value="COD"><COD /></Radio>
         <Radio value="online"><Online /></Radio>
      </Radio.Group>
      :
      <div onClick={change} className='md:border md:p-2 cursor-pointer flex justify-between'>
         {data === "COD" ? <COD /> : <Online />}
         <button className='text-xs md:text-sm text-blue-400'>Change method</button>
      </div>
}

export default PaymentMode

const COD = () =>
   <div>
      <p className='pl-2 font-semibold'>Cash on Delivery / Pay on Delivery</p>
      <p className='pl-2 text-xs'>Pay directly at the time of Delivery</p>
   </div>

